import React from 'react';
import { BrowserRouter as Router, Route, NavLink} from 'react-router-dom';
import TargetList from './TargetList';
import SuppresionList from './SuppresionList';
import './Navbar.css';


function Navbar() {
    return (
        <Router className="Router">
             <Route path = "/" component = {TargetList} exact></Route>
             <NavLink activeStyle={{  borderBottom:'2px solid red' }} className="Route" to="/" exact>Target List </NavLink>
             <Route path = "/suppresionList" component = {SuppresionList} ></Route>
             <NavLink activeStyle={{ borderBottom:'2px solid red'}} className="Route" to="/suppresionList">SuppresionList </NavLink>    
       </Router>
    )
}

export default Navbar
